import React from 'react';

const Footer = () => {
  return (
    <footer className="app-footer">
      <p>Аналог сайту flatuicolors.com; Створений за допомогою React.</p>
      <p>Автор: Падун Дмитро</p>
    </footer>
  );
};

export default Footer;
